Ребята , всем привет !  Есть интересное предложение в компанию Сибур по предиктивному техобслуживанию.
ОБЯЗАННОСТИ: 
:clubs:	Разработка серверной логики и интеграция внутренних сервисов;
:clubs:	Взаимодействие с front-end разработчиками и участие в разработке интерфейса.
ТРЕБОВАНИЯ:
:clubs:	Высшее образование по направлению ИТ, программирование, математики, кибернетики, менеджмент;
:clubs:	Python 3.X (ООП, сборка мусора, параллельное программирование, django, celery);
:clubs:	Продвинутое знание Linux, опыт работы с Docker;
:clubs:	Понимание стека сетевого взаимодействия, (Tcp, Udp, Http, Rest);
:clubs:	Знание Sql и понимание реляционной модели данных (PostgreSQL);
:clubs:	Опыт работы с NoSql системами (приоритет ElasticSearch, или опыт работы другими NoSql решениями: Mongo, Redis, Ignite, Memcached, LevelDB и т.д. ), очереди (RabbitMq, Kaffka);
:clubs:	HTML5 и CSS3 (кросс браузерная верстка); javascript (ecmascript 6 и выше), npm, webpack, react, redux, vue, GIT.
Желательно (будет плюсом):
:clubs:	Опыт интеграции с LDAP/Kerberos;
:clubs:	Опыт работы со стеком Hadoop или Vertica, опыт в java или scala, Http/2 и websocket.
УСЛОВИЯ:
:clubs:	Заработная плата по результатам собеседования;
:clubs:	Премии по результатам работы;
:clubs:	Социальный пакет;
:clubs:	Оформление по ТК РФ.
По зп : до 250 к гросс.   По всем вопросам пишите в личку ,  с радостью отвечу на все вопросы )
